import React from 'react';
import { motion } from 'framer-motion';
import { Helmet } from 'react-helmet-async';

const About = () => {
  return (
    <>
      <Helmet>
        <title>About - Artist Portfolio</title>
      </Helmet>

      <div className="about">
        {/* Hero Section with Unique Background */}
        <section className="about-hero" style={{
          position: 'relative',
          minHeight: '100vh',
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 25%, #f093fb 50%, #f5576c 75%, #4facfe 100%)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          overflow: 'hidden',
        }}>
          {/* Animated Background Elements */}
          <div style={{
            position: 'absolute',
            width: '100%',
            height: '100%',
            overflow: 'hidden',
          }}>
            {[...Array(20)].map((_, i) => (
              <motion.div
                key={i}
                style={{
                  position: 'absolute',
                  width: Math.random() * 100 + 50 + 'px',
                  height: Math.random() * 100 + 50 + 'px',
                  background: `rgba(255, 255, 255, ${Math.random() * 0.1 + 0.05})`,
                  borderRadius: '50%',
                  left: Math.random() * 100 + '%',
                  top: Math.random() * 100 + '%',
                }}
                animate={{
                  x: [0, Math.random() * 200 - 100],
                  y: [0, Math.random() * 200 - 100],
                  scale: [1, Math.random() * 0.5 + 0.8, 1],
                }}
                transition={{
                  duration: Math.random() * 10 + 10,
                  repeat: Infinity,
                  repeatType: 'reverse',
                  ease: 'easeInOut',
                }}
              />
            ))}
          </div>

          <div className="container" style={{ position: 'relative', zIndex: 2 }}>
            <motion.div
              initial={{ opacity: 0, y: 100 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 1.2 }}
              style={{ textAlign: 'center' }}
            >
              <motion.div
                initial={{ scale: 0.8, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                transition={{ duration: 1, delay: 0.3 }}
                style={{
                  width: '250px',
                  height: '250px',
                  margin: '0 auto 2rem',
                  background: 'linear-gradient(45deg, #ff6b6b, #4ecdc4, #45b7d1, #96ceb4)',
                  borderRadius: '50%',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  boxShadow: '0 20px 60px rgba(0,0,0,0.3)',
                  position: 'relative',
                }}
              >
                <div style={{
                  width: '90%',
                  height: '90%',
                  background: 'rgba(255,255,255,0.95)',
                  borderRadius: '50%',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  fontSize: '4rem',
                  background: 'linear-gradient(135deg, #667eea, #764ba2)',
                  WebkitBackgroundClip: 'text',
                  WebkitTextFillColor: 'transparent',
                  fontWeight: 'bold',
                }}>
                  A
                </div>
              </motion.div>

              <motion.h1
                initial={{ opacity: 0, y: 50 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 1, delay: 0.5 }}
                style={{
                  fontFamily: "'Playfair Display', serif",
                  fontSize: 'clamp(3rem, 8vw, 6rem)',
                  color: 'white',
                  marginBottom: '1rem',
                  textShadow: '0 10px 30px rgba(0,0,0,0.3)',
                  letterSpacing: '-2px',
                }}
              >
                About Me
              </motion.h1>

              <motion.p
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 1, delay: 0.7 }}
                style={{
                  fontSize: '1.3rem',
                  color: 'rgba(255,255,255,0.9)',
                  maxWidth: '600px',
                  margin: '0 auto',
                  lineHeight: 1.6,
                  textShadow: '0 5px 15px rgba(0,0,0,0.3)',
                }}
              >
                Musician â€¢ Artist â€¢ Storyteller
              </motion.p>
            </motion.div>
          </div>

          {/* Scroll Indicator */}
          <motion.div
            animate={{ y: [0, 10, 0] }}
            transition={{ duration: 2, repeat: Infinity }}
            style={{
              position: 'absolute',
              bottom: '30px',
              left: '50%',
              transform: 'translateX(-50%)',
              color: 'white',
              fontSize: '2rem',
            }}
          >
            â†“
          </motion.div>
        </section>

        {/* Story Section */}
        <section className="story-section" style={{
          padding: '6rem 0',
          background: 'linear-gradient(180deg, #1a1a1a 0%, #2d2d2d 100%)',
          position: 'relative',
        }}>
          <div className="container">
            <motion.div
              initial={{ opacity: 0, x: -100 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 1 }}
              viewport={{ once: true }}
              style={{
                display: 'grid',
                gridTemplateColumns: '1fr 1fr',
                gap: '4rem',
                alignItems: 'center',
              }}
            >
              <div>
                <motion.h2
                  initial={{ opacity: 0, y: 50 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8 }}
                  viewport={{ once: true }}
                  style={{
                    fontFamily: "'Playfair Display', serif",
                    fontSize: '3rem',
                    color: 'var(--text-primary)',
                    marginBottom: '2rem',
                    position: 'relative',
                  }}
                >
                  My Story
                  <motion.div
                    initial={{ width: 0 }}
                    whileInView={{ width: '100px' }}
                    transition={{ duration: 1, delay: 0.5 }}
                    viewport={{ once: true }}
                    style={{
                      height: '4px',
                      background: 'linear-gradient(90deg, #667eea, #764ba2)',
                      marginTop: '1rem',
                    }}
                  />
                </motion.h2>

                <motion.p
                  initial={{ opacity: 0, y: 30 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: 0.2 }}
                  viewport={{ once: true }}
                  style={{
                    fontSize: '1.1rem',
                    color: 'var(--text-secondary)',
                    lineHeight: 1.8,
                    marginBottom: '1.5rem',
                  }}
                >
                  From humble beginnings in a small town to international stages, my journey has been defined by passion, perseverance, and the universal language of music. Every note I play carries the stories of my experiences, the dreams that fueled my journey, and the connections I've made with audiences around the world.
                </motion.p>

                <motion.p
                  initial={{ opacity: 0, y: 30 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: 0.4 }}
                  viewport={{ once: true }}
                  style={{
                    fontSize: '1.1rem',
                    color: 'var(--text-secondary)',
                    lineHeight: 1.8,
                  }}
                >
                  Music isn't just what I doâ€”it's who I am. It's the voice I found when words weren't enough, the comfort I discovered in melodies, and the bridge I built to connect hearts across cultures and continents.
                </motion.p>
              </div>

              <motion.div
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 1, delay: 0.3 }}
                viewport={{ once: true }}
                style={{
                  position: 'relative',
                }}
              >
                <div style={{
                  width: '100%',
                  height: '400px',
                  background: 'linear-gradient(135deg, #667eea, #764ba2, #f093fb)',
                  borderRadius: '20px',
                  position: 'relative',
                  overflow: 'hidden',
                  boxShadow: '0 30px 60px rgba(0,0,0,0.3)',
                }}>
                  <div style={{
                    position: 'absolute',
                    inset: 0,
                    background: 'url("https://images.unsplash.com/photo-1514320291840-2e0a9bf2a9ae?w=800&h=600&fit=crop") center/cover',
                    opacity: 0.3,
                  }} />
                  <div style={{
                    position: 'absolute',
                    inset: 0,
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    fontSize: '6rem',
                    color: 'white',
                    opacity: 0.8,
                  }}>
                    ðŸŽµ
                  </div>
                </div>
              </motion.div>
            </motion.div>
          </div>
        </section>

        {/* Philosophy Section */}
        <section className="philosophy-section" style={{
          padding: '6rem 0',
          background: 'linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%)',
          position: 'relative',
        }}>
          <div className="container">
            <motion.div
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 1 }}
              viewport={{ once: true }}
              style={{ textAlign: 'center', marginBottom: '4rem' }}
            >
              <h2 style={{
                fontFamily: "'Playfair Display', serif",
                fontSize: '3rem',
                color: 'var(--text-primary)',
                marginBottom: '1rem',
              }}>
                Musical Philosophy
              </h2>
              <p style={{
                fontSize: '1.2rem',
                color: 'var(--text-secondary)',
                maxWidth: '600px',
                margin: '0 auto',
              }}>
                The principles that guide every note I compose and every performance I give
              </p>
            </motion.div>

            <div style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
              gap: '3rem',
            }}>
              {[
                {
                  icon: 'ðŸŽ­',
                  title: 'Authenticity',
                  description: 'Every performance is a genuine expression of emotion and experience, never just a technical exercise.'
                },
                {
                  icon: 'ðŸŒ',
                  title: 'Connection',
                  description: 'Music is the universal language that transcends barriers and brings people together in shared experience.'
                },
                {
                  icon: 'âœ¨',
                  title: 'Innovation',
                  description: 'Pushing boundaries while honoring traditions, creating something uniquely mine yet universally relatable.'
                }
              ].map((item, index) => (
                <motion.div
                  key={index}
                  initial={{ opacity: 0, y: 50 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: index * 0.2 }}
                  viewport={{ once: true }}
                  style={{
                    background: 'linear-gradient(135deg, rgba(102, 126, 234, 0.1), rgba(118, 75, 162, 0.1))',
                    padding: '2.5rem',
                    borderRadius: '20px',
                    textAlign: 'center',
                    border: '1px solid rgba(102, 126, 234, 0.2)',
                    backdropFilter: 'blur(10px)',
                  }}
                >
                  <div style={{
                    fontSize: '3rem',
                    marginBottom: '1rem',
                  }}>
                    {item.icon}
                  </div>
                  <h3 style={{
                    fontSize: '1.5rem',
                    color: 'var(--text-primary)',
                    marginBottom: '1rem',
                  }}>
                    {item.title}
                  </h3>
                  <p style={{
                    color: 'var(--text-secondary)',
                    lineHeight: 1.6,
                  }}>
                    {item.description}
                  </p>
                </motion.div>
              ))}
            </div>
          </div>
        </section>

        {/* Journey Timeline */}
        <section className="journey-section" style={{
          padding: '6rem 0',
          background: 'linear-gradient(180deg, #1a1a1a 0%, #2d2d2d 100%)',
        }}>
          <div className="container">
            <motion.div
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 1 }}
              viewport={{ once: true }}
              style={{ textAlign: 'center', marginBottom: '4rem' }}
            >
              <h2 style={{
                fontFamily: "'Playfair Display', serif",
                fontSize: '3rem',
                color: 'var(--text-primary)',
                marginBottom: '1rem',
              }}>
                Musical Journey
              </h2>
            </motion.div>

            <div style={{ position: 'relative' }}>
              {/* Timeline Line */}
              <div style={{
                position: 'absolute',
                left: '50%',
                top: 0,
                bottom: 0,
                width: '4px',
                background: 'linear-gradient(180deg, #667eea, #764ba2, #f093fb)',
                transform: 'translateX(-50%)',
              }} />

              {[
                {
                  year: '2015',
                  title: 'The Beginning',
                  description: 'First guitar lesson and the discovery of a lifelong passion.',
                  side: 'left'
                },
                {
                  year: '2018',
                  title: 'First Performance',
                  description: 'Debut at local venue, received standing ovation.',
                  side: 'right'
                },
                {
                  year: '2020',
                  title: 'Breakthrough Album',
                  description: 'Released first studio album, topped indie charts.',
                  side: 'left'
                },
                {
                  year: '2023',
                  title: 'World Tour',
                  description: 'Performed in 15 countries, connected with global audiences.',
                  side: 'right'
                }
              ].map((milestone, index) => (
                <motion.div
                  key={index}
                  initial={{ opacity: 0, x: milestone.side === 'left' ? -100 : 100 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  transition={{ duration: 0.8, delay: index * 0.2 }}
                  viewport={{ once: true }}
                  style={{
                    display: 'flex',
                    justifyContent: milestone.side === 'left' ? 'flex-end' : 'flex-start',
                    marginBottom: '4rem',
                    position: 'relative',
                  }}
                >
                  <div style={{
                    width: milestone.side === 'left' ? '45%' : '45%',
                    padding: milestone.side === 'left' ? '2rem 2rem 2rem 0' : '2rem 0 2rem 2rem',
                  }}>
                    <div style={{
                      background: 'linear-gradient(135deg, rgba(102, 126, 234, 0.1), rgba(118, 75, 162, 0.1))',
                      padding: '2rem',
                      borderRadius: '15px',
                      border: '1px solid rgba(102, 126, 234, 0.2)',
                    }}>
                      <div style={{
                        fontSize: '0.9rem',
                        color: '#667eea',
                        fontWeight: 'bold',
                        marginBottom: '0.5rem',
                      }}>
                        {milestone.year}
                      </div>
                      <h3 style={{
                        fontSize: '1.3rem',
                        color: 'var(--text-primary)',
                        marginBottom: '1rem',
                      }}>
                        {milestone.title}
                      </h3>
                      <p style={{
                        color: 'var(--text-secondary)',
                        lineHeight: 1.6,
                      }}>
                        {milestone.description}
                      </p>
                    </div>
                  </div>

                  {/* Timeline Dot */}
                  <div style={{
                    position: 'absolute',
                    left: '50%',
                    top: '2rem',
                    transform: 'translateX(-50%)',
                    width: '20px',
                    height: '20px',
                    background: 'linear-gradient(135deg, #667eea, #764ba2)',
                    borderRadius: '50%',
                    border: '4px solid #1a1a1a',
                    boxShadow: '0 0 20px rgba(102, 126, 234, 0.5)',
                  }} />
                </motion.div>
              ))}
            </div>
          </div>
        </section>

        {/* Call to Action */}
        <section className="cta-section" style={{
          padding: '6rem 0',
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 50%, #f093fb 100%)',
          textAlign: 'center',
          position: 'relative',
          overflow: 'hidden',
        }}>
          {/* Background Pattern */}
          <div style={{
            position: 'absolute',
            inset: 0,
            opacity: 0.1,
            backgroundImage: `url("data:image/svg+xml,%3Csvg width="60" height="60" viewBox="0 0 60 60" xmlns="http://www.w3.org/2000/svg"%3E%3Cg fill="none" fill-rule="evenodd"%3E%3Cg fill="%23ffffff" fill-opacity="0.4"%3E%3Ccircle cx="30" cy="30" r="4"/%3E%3C/g%3E%3C/g%3E%3C/svg%3E")`,
          }} />

          <div className="container" style={{ position: 'relative', zIndex: 2 }}>
            <motion.div
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 1 }}
              viewport={{ once: true }}
            >
              <h2 style={{
                fontFamily: "'Playfair Display', serif",
                fontSize: '3rem',
                color: 'white',
                marginBottom: '1.5rem',
                textShadow: '0 10px 30px rgba(0,0,0,0.3)',
              }}>
                Let's Create Something Beautiful Together
              </h2>
              <p style={{
                fontSize: '1.2rem',
                color: 'rgba(255,255,255,0.9)',
                maxWidth: '600px',
                margin: '0 auto 3rem',
                lineHeight: 1.6,
              }}>
                Whether it's a collaboration, performance opportunity, or just a hello - I'd love to hear from you.
              </p>
              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                style={{
                  background: 'white',
                  color: '#667eea',
                  padding: '1rem 3rem',
                  border: 'none',
                  borderRadius: '50px',
                  fontSize: '1.1rem',
                  fontWeight: 'bold',
                  cursor: 'pointer',
                  boxShadow: '0 20px 40px rgba(0,0,0,0.2)',
                  transition: 'all 0.3s ease',
                }}
                onClick={() => window.location.href = '/contact'}
              >
                Get In Touch
              </motion.button>
            </motion.div>
          </div>
        </section>
      </div>
    </>
  );
};

export default About;
